import React from "react";

const VideoModal = ({ onClose }) => {
    return (
        <div className="video-modal-overlay" onClick={onClose}>
            <div className="video-modal">
            <video controls>
            <source src="./Assets/video-about.mp4" type="video/mp4" />
          </video>

            </div>
        </div>
    );
};

export default VideoModal;
